import React from "react";
import styles from './experience.module.css';
import {
    Card,
    CardHeader,
    CardBody,
    CardText,
    CardTitle,
    Button
  } from 'reactstrap';

const Experience = () => {
    return (
        <>
        <section id={styles.experienceContainer}>
            <div id={styles.experienceCard}>
                <div id={styles.experienceRole}>
                    <h1>Role Name</h1>
                </div>

            </div>

        </section>

        </>
    )
}

export default Experience;
